WYSIWYG_IMAGE_UUID = "dd93dcb4-4372-9740-d39a-16ae1feaedd4"


class VDOM_flot(VDOM_object):

	def render(self, contents=""):

		id = 'o_' + (self.id).replace('-', '_')

		result = u""""""

		if self.visible == "1":
			show = ""
		else:
			show = "style='display:none'"

		if self.options == "":
			options = ""
		else:
			options = u", %s" % self.options

		result += "<div " + show + " id='" + id + "' style='left:"+self.left+"px;top:"+self.top+"px;position:absolute;overflow:hidden;width:"+self.width+"px;height:"+self.height+"px;'>" + contents + "</div>"

		if self.bars == "1":
			bars = "true"
		else:
			bars = "false"

		if self.lines == "1":
			lines = "true"
		else:
			lines = "false"

		if self.points == "1":
			points = "true"
		else:
			points = "false"

		if (self.jsondata).strip() == "":
			jsondata = "[]"
		else:
			jsondata = self.jsondata

		result += """<script type='text/javascript'>
$j(function(){
	$j('#""" + id + """').data('opt', {
		lines: { show: """+lines+""" },
		points: { show: """+points+""" },
		bars: { show: """+bars+""" }
		"""+options+"""
	});
	if (/MSIE|Trident/.test(navigator.userAgent)) {
		setTimeout(function() {
			$j.plot($j('#""" + id + """'), """+jsondata+""", $j('#""" + id + """').data('opt'));
		}, 500);
	} else {
		$j.plot($j('#""" + id + """'), """+jsondata+""", $j('#""" + id + """').data('opt'));
	}
});
</script>"""

		return VDOM_object.render(self, contents=result)

	def wysiwyg(self, contents=""):
		from scripting.legacy.wysiwyg import get_empty_wysiwyg_value
		result = get_empty_wysiwyg_value(self, WYSIWYG_IMAGE_UUID)
		return VDOM_object.wysiwyg(self, contents=result)
